UML:TaggedValue.value:
Deletes a column in this layout.  All components to the right of the deletion point are moved left one column.  The container will need to be laid out after this method returns.  See <code>setColumn</code>. 
@see #setColumn
@see #deleteColumn

Deletes a row in this layout.  All components below the deletion point are moved up one row.  The container will need to be laid out after this method returns.  See <code>setRow</code>.  There must be at least two rows in order to delete a row. 
@see #setRow
@see #deleteRow

Gets the sizes of columns in this layout. 
@return widths of each of the columns 
@see #setColumn

Gets the width of a single column in this layout. 
@return width of the requested column 
@see #setRow

Determines whether or not there are any components with invalid constraints. An invalid constraint is one that references a non-existing row or column. For example, on a table with five rows, row -1 and row 5 are both invalid. Valid rows are 0 through 4, inclusively.  This method is useful for debugging. 
@return a list of TableLayout.Entry instances refering to the invalid constraints and corresponding components 
@see #getOverlappingEntry

Gets a list of overlapping components and their constraints.  Two components overlap if they cover at least one common cell.  This method is useful for debugging. 
@return a list of zero or more TableLayout.Entry instances 
@see #getInvalidEntry

Gets the height of a single row in this layout. 
@return height of the requested row 
@see #setRow

Gets the sizes of a row in this layout. 
@return height of each of the requested row 
@see #setRow

Inserts a column in this layout.  All components to the right of the insertion point are moved right one column.  The container will need to be laid out after this method returns.  See <code>setColumn</code>. 
@see #setColumn
@see #deleteColumn

Inserts a row in this layout.  All components below the insertion point are moved down one row.  The container will need to be laid out after this method returns.  See <code>setRow</code>. 
@see #setRow
@see #deleteRow

Adjusts the number and sizes of rows in this layout.  After calling this method, the caller should request this layout manager to perform the layout.  This can be done with the following code: 
<pre> layout.layoutContainer(container); container.repaint();
</pre>  or 
<pre> window.pack()
</pre>  If this is not done, the changes in the layout will not be seen until the container is resized. 
@see #getColumn

