Unregisteres Output Subscriber. 
@param publisherID ID of output subscriber
@param publisher output subscriber reference

This method is called by the output bus and determines whether a dialog can be shown directly (e.g. by comparing the dialogs priority with the priority of a dialog that is currently shown). Additionally, it adds adaptation parameters.
@see org.universAAL.middleware.output.DialogManager#checkNewDialog(OutputEvent)
@return true, if the dialog can be shown directly.
